import React, { Component } from "react";

import Card from 'react-bootstrap/Card'
import ListGroup from 'react-bootstrap/ListGroup'

function CardPromotion() {
    return (
        <Card className="flex m-1.5 px-12 shadow-boxShadow bg-background-color">
            <Card.Body>
                <Card.Header className="text-text-color"> Minimo de 15 pessoas </Card.Header> <br />
                <ListGroup variant="flush" className="text-text-color">
                    <ListGroup.Item>4 horas de permanencia no box</ListGroup.Item>
                    <ListGroup.Item>Sanduiche</ListGroup.Item>
                    <ListGroup.Item>Mini pizzas</ListGroup.Item>
                    <ListGroup.Item>Mini assados</ListGroup.Item>
                    <ListGroup.Item>Pasteis</ListGroup.Item>
                    <ListGroup.Item>Salgados</ListGroup.Item>
                    <ListGroup.Item>Água</ListGroup.Item>
                    <ListGroup.Item>Refrigerante</ListGroup.Item>
                    <ListGroup.Item>Cerveja (Bohemia e Original)</ListGroup.Item>  
                </ListGroup>   
            </Card.Body>
        </Card>
    );
}

class Promotions extends Component {
    render() {
        return (
            <div>
                <h1 className="text-title-color flex justify-self-center p-8">Promoções</h1>
                <section className="flex-col grid justify-items-stretch place-content-center">
                    <p className=" text-text-color flex justify-self-center p-8">
                        Faça sua festa, festa de aniversario, happy hour, confraternização, etc, no melhor karaokê de São Paulo.
                    </p>
                    <h2 className="text-title-color flex justify-self-center p-8">
                        Pacote Especial
                    </h2>
                    <CardPromotion />
                </section>
            </div>
        );
    }
}

export default Promotions
